import React from 'react'
import './statics/styles/ChatInput.scss'
import {
    Send,
    NavigateNext
} from '@material-ui/icons'

import {
    Fab
} from '@material-ui/cores'

function ChatInput () {
    return (
        <div className='ChatInput'>
            <div>
                <NavigateNext/>
            </div>
            <input/>
            <Fab color="primary" aria-label="add">
                <Send/>
            </Fab>
        </div>
    )
}

export default ChatInput
